INSERT INTO `shine_feedback` (`id`, `appname`, `appversion`, `systemversion`, `email`, `reply`, `type`, `message`, `importance`, `critical`, `dt`, `ip`, `new`, `starred`, `deleted`, `reguser`, `regmail`, `notes`) VALUES
(1, 'BeFit', '3.6', '10.8.5', 'johnbakker@mac.com', 0, 'bug', 'What did you expect to happen?\nThe programme keeps coming us with the message \"An error occurred whilst saving\".  Approx every 60-90 seconds whilst in use. (v3.6)\n\n\n\nWhat steps will reproduce the problem?\n', '', 0, '2014-03-28 05:16:18', '82.8.138.173', 0, 0, 0, '', '', 'Hi John -\r\n\r\nThanks for the feedback, please download the Mac App Store version and let me know if the problems persist. \r\n\r\nhttp://tokn.co/wmskbn5j\r\n\r\nApologies for the issues your having thus far, looking forward to squashing this bug, thanks for reporting it!!\r\n\r\n** Make sure to remove all copies of the BeFit program before installing the App Store version, I would uninstall the program by using a Mac App uninstaller program like http://www.freemacsoft.net/appcleaner/ to be sure that its not an issue with an old or corrupt user database.\r\n\r\nJon'),
(2, 'BeFit', '3.7', '10.9.2', 'jon@jonbrown.org', 0, 'support', 'Test', '', 0, '2014-04-05 19:21:19', '173.79.66.195', 0, 0, 0, '', '', 'Test'),
