(52, 'BeFit Trial', '5.0.1', '10.13', 'rvince01@hotmail.com', 0, 'feature', 'I was very interested in your app till I perused some of the data.  According to your app all wine beverages contain 85 cal per oz.  My resources say around 120 cal per 5 oz.  Beer is also quite high.  Do you have some information no one else has or is this an error.  Makes me doubt the data in the entire app.  Thanks', 'Deal breaker', 0, '2017-10-28 12:49:26', '108.162.246.217', 0, 0, 0, '', '', ''),
